INSERT INTO `event` VALUES (1,'MJ LIVE - Michael Jackson Tribute','Michael Jackson','Michael Jackson是美國流行音樂歌手，常被尊稱為「流行樂之王」（King of Pop）。由於Michael Jackson在音樂、舞蹈、時尚方面的巨大貢獻，加之令人備受關注的個人生活，他成為全球流行文化的代表人物長達40年。Michael Jackson於1982年所發行的專輯《Thriller》是迄今為止全球銷量最高的專輯。其它專輯，包括《Off The Wall》（1979年）、《Bad》（1987年）、《Dangerous》（1991年）、《HIStory》（1995年）也躋身全球銷量最高的專輯行列。<br/><br/>Michael Jackson是為數不多的已2次入選搖滾名人堂藝術家之一，也有被選入作曲者名人堂，並且是唯一一位進入舞蹈名人堂的流行藝人。他的其它成就包括多項金氏世界紀錄，13個葛萊美獎、「葛萊美傳奇獎」、「葛萊美終身成就獎（英語：Grammy Lifetime Achievement Award）」，26個全美音樂獎，為所有藝人之最，其中包括「世紀藝術家」、「20世紀80年代藝術家」，在他單飛生涯中，他擁有13個美國冠軍單曲，在告示牌百大單曲榜中超過其他任何男歌手，以及超過5億的全球銷量記錄。','1.png','1-1.png','https://www.youtube.com/embed/jDRTghGZ7XU','2023-10-01 21:00:00'),(2,'TWICE - TWICE 4TH WORLD TOUR','TWICE','TWICE，為韓國JYP娛樂旗下的九人女子團體，成員們通過 Mnet 生存實境類節目《SIXTEEN》篩選而出。最終由五名韓國成員娜璉、定延、志效、多賢、彩瑛，三名日本成員 Momo、Sana、Mina 以及一名台灣成員子瑜組成，並由志效擔任隊長，2015年10月20日以首張迷你專輯《The Story Begins》正式出道。 <br/><br/>截至 2022 年，TWICE 已在韓國本土售出超過 790 萬張專輯，是南韓史上最暢銷的女子團體。全球總銷量更是達到1130 萬張，位居韓國女子團體第一。在 YouTube 平台上，TWICE 亦為擁有最多音樂錄影帶觀看次數破一億的女子團體紀錄保持者，有 21 支音樂錄影帶達成此觀看里程碑。根據韓國文化振興院「2017韓流白皮書」，將TWICE列為第三代 K-Pop 女團代表，表彰其對於推廣韓國流行音樂國際化的重要貢獻。','2.png','2-1.png','https://www.youtube.com/embed/i0p1bmr0EmE','2022-09-08 21:00:00'),(3,'IU - LOVEPOEM','IU','IU 15歲時推出首張迷你專輯《Lost and Found》，開始歌手生涯，隨後發行的專輯《Growing Up》和《IU...IM》使IU的知名度上漲。真正讓IU在韓國走紅的是她在2010年發佈的專輯《Real》的主打歌《好日子》。《好日子》連續五周位居韓國Gaon數位榜榜首，與PSY的《江南Style》共同保持著維持一位周數最長的紀錄，並且在2019年，其在公告牌的「2010年代最偉大的100首K-Pop歌曲 」名單中排名第一。<br /><br />IU共發布過5張錄音室專輯和5張迷你專輯，以及2張懷舊歌曲翻唱輯，在Gaon榜有2張專輯和14首歌曲獲得第一名。IU自2012年起一直位列《富比士》雜誌的年度韓國名人權力榜40強之一，2012年達到最高的第3名。公告牌將IU認可為韓國流行音樂百強榜的先鋒，她是擁有最多的冠軍歌曲並且是維持第一位置周數最長的藝人。她在2014年和2017年被評為Gallup韓國年度最佳歌手（Gallup Korea\'s Singer of the Year）。','3.png','3-1.png','https://www.youtube.com/embed/v7bnOxV4jAc','2022-09-06 21:00:00'),(4,'Coldplay - A Head Full of Dreams','Coldplay','酷玩樂團（Coldplay）是成立於1997年、來自倫敦的英國另類搖滾樂團。團員包括克里斯·馬汀（主唱、鍵盤、吉他）、強尼·邦藍（主奏吉他）、蓋·貝瑞曼（貝斯吉他）及威爾·查恩（鼓、合音、其他樂器）。樂團最早成形於馬汀與邦藍就讀於倫敦大學學院時期，馬汀與邦藍組成了Pectoralz樂團之後，貝瑞曼加入樂團作為貝斯手，他們更名為海星樂團。查恩是最後一個加入樂團的成員,當查恩加入了樂團之後，他們把樂團的名字改為酷玩樂團。<br /><br />他們的前經理人菲爾·哈維通常都被當作為樂團第五個（非官方）成員。     酷玩樂團在整個職業生涯贏得了多項音樂獎項,包括八個全英音樂獎、七個格萊美獎、五個MTV音樂錄影帶獎。酷玩樂團的全球銷量已超過8000萬,成為其中一位史上最暢銷的藝人。<br /><br />酷玩樂團同時也積極投身於社會與政治組織活動，如樂施會的貿易要公平活動及國際特赦組織等。酷玩樂團亦參與演出各式慈善活動中，如Band Aid 20、現場八方、青少年癌症籌款音樂會等。名列歌迷最想看的西洋演唱會前十名，Coldplay酷玩樂團終於來到台灣，並且是兩岸三地唯一舉辦的地區，台灣歌迷期盼許久，首度來台，不必花錢出國，全球賣出超過兩百萬張門票、最夯的演唱會就在台灣！親身體驗Coldplay的LIVE魅力！','4.png','4-1.png','https://www.youtube.com/embed/vitp2fLRHT0','2022-09-05 21:00:00'),(5,'LANY a november to remember','LANY','後疫情時代迫不及待要用LIVE舞台和全球歌迷見面的加州新生代樂團LANY，兩位高顏質成員Paul Klein和Jake Goss繼2017年首度在台開唱之後，將二度以浪漫搖滾風潮席捲台灣。累積超過35億線上串流點聽次數、7.5億的影片點閱次數和全球逾50萬的演唱會動員人數。LANY為亞洲歌迷專屬打造最難忘的11月全新巡演，疫情期間發行的兩張新專輯【Mama’s Boy】、【gg bb xx】收錄歌曲一次完美呈現，從第一站台灣起跑，帶給歌迷亞洲限定的全新音樂感受和現場體驗！','5.png','5-1.png','https://www.youtube.com/embed/c_10qS7amjk','2022-09-04 21:00:00'),(6,'Alec Benjamin: The (Un)Commentary Tour','Alec Benjamin','療癒系創作新星 Alec Benjamin即將帶著新專輯巡迴首度登台！\n\n擁有「音樂說書人」封號的Alec，擅長以音樂描寫自己眼中的世界，將你我生活中看似尋常的點滴編織成篇篇動人的音樂故事。從小就立志成為歌手的Alec，其實在圓夢的路上並不順遂，甚至曾遭前公司單方解約而失去所有音樂版權，但他不畏艱難勇敢追夢，帶著一把吉他走上街頭獻唱，憑著自己不放棄的毅力及獨具風格的清新嗓音，累積了一批死忠粉絲，並以破億心碎神曲<Let Me Down Slowly>爆紅而成功獲得全球樂壇矚目。苦練中文多年的他，也曾將自己多首歌曲翻唱成中文版本，屆時台灣場次會端出什麼樣的台灣場限定驚喜歌單，相信可以好好期待！','6.png','6-1.png','https://www.youtube.com/embed/50VNCymT-Cs','2022-09-03 21:00:00'),(7,'Ariana Grande Dangerous Woman Tour ','Ariana Grande','擁有秒殺全球70國iTunes 排行榜冠軍，Youtube頻道有40億點擊次記錄的西洋鐵肺小天后 - 亞莉安娜（Ariana Grande)，帶著她出道以來最大規模的世界巡迴演唱會《Dangerous Woman Tour》即將來到台灣台北小巨蛋演出。2016年被時代雜誌冊封「最影響力人物」的亞莉安娜，再度入圍2017葛萊美獎「最佳流行歌手」等兩項大獎，同時也是《美女與野獸》真人版電影全球主題曲演唱者，帶著新巡迴即將引爆台灣！','7.png','7-1.png','https://www.youtube.com/embed/tcYodQoapMg','2022-09-02 21:00:00'),(8,'Anne-Marie DYSFUNCTIONAL TOUR','Anne-Marie','多次受到全英音樂獎入圍肯定，在串流平台累積逾50億點聽次數的英倫冠軍歌姬安瑪莉(Anne-Marie)，相隔三年將二度訪台開唱。在疫情期間推出新專輯<音樂療程Therapy>，安瑪莉再度發揮創作力，以音樂療癒自己也撫慰每一個歌迷的心。三年前首度在台開唱，門票搶購一空讓許多歌迷大喊可惜，在舞台上率性自然的表演更是讓在場粉絲直呼超可愛，絕對值回票價！2022年安瑪莉的女力舞台重現台灣，用滿滿正能量帶你體驗她的音樂療程！','8.png','8-1.png','https://www.youtube.com/embed/jzD_yyEcp0M','2021-09-01 21:00:00');
